import Banner from "../components/ShopPage/Banner";
import ShoppingCart from "../components/CartPage/ShoppingCart";
//---------------------component--------------------------
function CartPage() {
  //----------------------------
  return (
    <>
      <Banner page="CART"></Banner>
      <ShoppingCart></ShoppingCart>
    </>
  );
}
export default CartPage;
